import React, {useContext, useEffect} from 'react'
import mainContext from '../context/mainContext'

const MessagesPage = () => {

    const {socket} = useContext(mainContext) 

    useEffect(()=> {
        socket.on("updatemsg", (data) => {
            console.log(data)
        })

    },[socket])

  return (
    <div>MessagesPage</div>
  )
}

export default MessagesPage
